import "./App.scss";
import React from "react";
import Home from "./pages/Home";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from "./components/Header/Header";
import SignUp from "./components/SignUpModal/SignUpModal";
// import Login from "./components/Login/Login";
import OnSale from "./components/ProductDetail/ProductDetail";
import itemList from "./components/itemList/itemList";
import Catgegories from "./components/Categories/Catgegories";
// import AppContext from "./components/AppContext/AppContext";
// import WhatsNew from "./components/WhatsNew/WhatsNew";
import ProtectedRoute from "./components/ProtectedRoute";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { ContextProvider } from "./components/AppContext/AppContext";
import ShoppingCart from "./components/ShoppingCart/ShoppingCart";

function App() {
  return (
    <ContextProvider>
      <Router>
        <Header />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/categories" exact component={Catgegories} />
          <Route path="/categories/:id" exact component={itemList} />
          <Route path="/product/:id" exact component={OnSale} />
          <ProtectedRoute exact path="/cart" component={ShoppingCart} />
          <Route path="/cart" exact />
        </Switch>
      </Router>
    </ContextProvider>
  );
}

export default App;
